import React from 'react';
import './Post3.css';

export function Post3() {
    return (
      <section className="container-Post3">
        <p>{props.usuario}</p>
        <img src={props.imageComment} alt=""/>
        <img src={props.imageFavoriteWhite} alt=""/>
        <img src={props.imageFavorite} alt=""/>

      </section>
    )
}

Post3.propTypes = {
  usuario: PropTypes.string.isRequired,
  imageComment: PropTypes.string.isRequired,
  imageFavoriteWhite: PropTypes.string.isRequired,
  imageFavorite: PropTypes.string.isRequired,

}
